$\textbf{Stare Tereny Juana}$

Juan organizuje znaczki w swojej kolekcji według kraju i dekady, w której zostały wydane. Ceny, które zapłacił za nie w sklepie filatelistycznym, wynosiły: Brazylia i Francja, $6$ centów każdy, Peru $4$ centy każdy, a Hiszpania $5$ centów każdy. (Brazylia i Peru to kraje Ameryki Południowej, a Francja i Hiszpania są w Europie.) [asy]
