Prostokąt $ABCD$ ma środek $O$ i $AB/AD=k$. Punkt jest losowo wybierany z wnętrza prostokąta $ABCD$. Jakie jest prawdopodobieństwo, że jest on bliżej $O$ niż któregokolwiek z czterech wierzchołków?  [asy]
size(200);
draw((-250,100)--(250,100)--(250,-100)--(-250,-100)--cycle);
dot((0,0));
label("$O$",(0,0),N);
label("$A$",(-250,100),NW); label("$B$",(250,100),NE); label("$C$",(250,-100),SE); label("$D$",(-250,-100),SW);[/asy]

